import React from "react";
import "./nav.css";
import Rowbox from "./Rowbox";
const NavBar = () => {
  return (
    <div>
      <div className="navbox">
        <div className='netflix_logo'>
        </div>
        <div className="sign_in_button">SIGN IN</div>
        <div className="navbox_end">JOIN </div>
      </div>
      <Rowbox />
    </div>
  );
};

export default NavBar;
